import React from 'react';
import './App.css';
import emotion from "./Icons/Small Icons/mood-24px-grey.svg";
import tactor from "./Icons/Small Icons/tactor-grey.svg";
import behavior from "./Icons/Small Icons/touch-grey.svg";
import neutral from "./Icons/Emotion/Emotion_Neutral.svg";
import squeeze from "./Icons/Tactor/Gesture icons_Squeeze-15.svg";
import Emotion from './emotion';

class Home extends React.Component{

}

class LeftNav extends React.Component{
constructor(props) {
  super(props);
  this.state = {
    home: true,
  };
}

handleClick(name) {
  switch (name) {
    case "home":
      this.setState({ home: !this.state.home});
      break;
  }
}


  render(){
  return(
      <section class="page-content">
            <div class ="row left-nav group1">
              <div class="col-2 bg-light  sidebar d-flex">
                <div class ="row left-nav group1">
                <div class="col-12 left-col">
                <nav class="navbar left-nav navbar-expand navbar-light">
                <ul class="left-nav nav-item text-left">
                  <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" onClick={() => alert('click')}><img src={emotion} alt="" class="left-nav icon"/>Emotion</a></li>
                  <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" onClick={() => alert('click')}><img src={tactor} alt="" class="left-nav icon"/>Tactor</a></li>
                  <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" onClick={() => alert('click')}><img src={behavior} alt="" class="left-nav icon"/>Behavior</a></li>
                </ul>
              </nav>
                </div>
                </div>

              </div>
              {this.state.home && (

              <div class="col-10 main-content">
              <section class="main-head">


                <h2>Touch Generator</h2>
                <h3>Create a new emotional robot touch clip</h3>

              </section>
              <section class="generator-table">
                <div class="row generator justify-content-center">
                  <div class="col col-auto" >
                    <div class="bg-light touchgen-box touchgen d-flex align-items-center" onClick={() => this.handleClick("home")}>
                    <img src={neutral} alt="" class="generator-logo"/>
                  </div>

                    <h4 class="text-center text-uppercase mx-auto">Emotion</h4>

                  </div>
                  <div class="col col-auto d-flex align-items-center">
                    <h2 class="generator">OR</h2>
                    </div>
                  <div class="col col-auto">
                    <div class="bg-light  touchgen-box  touchgen d-flex align-items-center" onClick={() => alert('click')}>
                      <img src={squeeze} alt="" class="generator-logo"/>
                    </div>
                    <h4 class="text-center text-uppercase mx-auto">Tactor</h4>
                  </div>
                </div>

              </section>
              </div>
            )}

              </div>
          </section>
)
}
}

export default LeftNav;
